function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        Homepage
      </a>
      {/* <a className="navbar-brand" href={MyList} >
        My Reading List
      </a> */}
  <ul class="nav ">
  <li class="nav-item">
    <a class="nav-link active text-white" href="#">My List</a>
  </li>
  </ul>
    </nav>
  );
}

export default Nav;
